-- ----------------------------
-- Table structure for `city`
-- ----------------------------
DROP TABLE IF EXISTS `city`;
CREATE TABLE `city` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'city表主键，自增量',
  `name` varchar(45) COLLATE utf8_bin NOT NULL COMMENT '城市名字',
  `pinyin` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '城市拼音名字，比如上海就是shanghai',
  `sort` int(11) DEFAULT NULL COMMENT '排序',
  `province_id` int(11) NOT NULL,
  `last_modify_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `name_UNIQUE` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=13424 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='城市表';

