-- ----------------------------
-- Table structure for `cityregion`
-- ----------------------------
DROP TABLE IF EXISTS `cityregion`;
CREATE TABLE `cityregion` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '区域ID，自增量',
  `parent_id` int(11) DEFAULT NULL COMMENT '父ID',
  `path` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '路径',
  `deep` int(11) DEFAULT NULL COMMENT '深度',
  `name` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '区域名称',
  `city_id` int(11) NOT NULL COMMENT '城市ID',
  `last_modify_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `pinyin` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1311105 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='城市内的区域表\n用来描述城市内的各个地区和他们之间的父子关系';

