-- ----------------------------
-- Table structure for `user`
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `login_name` varchar(50) NOT NULL COMMENT '登录名',
  `password` varchar(45) DEFAULT NULL COMMENT '密码',
  `pay_password` varchar(50) DEFAULT NULL COMMENT '支付密码',
  `mobile` varchar(21) DEFAULT NULL COMMENT '手机号码',
  `email` varchar(45) DEFAULT NULL COMMENT '邮箱',
  `mobile_status` tinyint(2) DEFAULT '0' COMMENT '手机验证状态 0未验证 1已验证',
  `email_status` tinyint(2) DEFAULT '0' COMMENT '邮件验证状态 0未验证 1已验证',
  `mobile_verify_code` varchar(15) DEFAULT '' COMMENT '手机验证码',
  `email_verify_code` varchar(45) DEFAULT '' COMMENT '邮箱验证码',
  `register_ip` varchar(45) DEFAULT NULL COMMENT '注册IP',
  `register_time` timestamp NULL DEFAULT NULL COMMENT '注册时间',
  `last_login_time` timestamp NULL DEFAULT NULL COMMENT '最近登录时间',
  `last_login_ip` varchar(45) DEFAULT NULL COMMENT '最近登录IP',
  `last_modify_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `gender` tinyint(2) DEFAULT NULL COMMENT '性别',
  `real_name` varchar(45) DEFAULT NULL COMMENT '真实姓名',
  `birthday` datetime DEFAULT NULL,
  `is_active` tinyint(2) DEFAULT '1' COMMENT '1激活 0禁止',
  `cityRegion_id` int(11) DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `email` (`email`),
  KEY `mobile` (`mobile`),
  KEY `mobile_status` (`mobile_status`),
  KEY `login_name` (`login_name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户表\r\n用户表记录了用户的基本信息\r\n每一个用户有一个唯一标示的ID\r\n每一个用户都会绑定一个手机号码，用户和手机是一对一';

